package week1.day2;

public class ArithmeticOperator {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		ArithmeticOperator object=new
		ArithmeticOperator();
		object.add();
		object.sub();
	}
	public void add()
	{
		int a=12;
		int b=8;
		int c=a+b;
		System.out.println(c);
	}
	public void sub()
	{
		int a=12;
		int b=8;
		int c=a-b;
		System.out.println(c);
				

	}

}
